import NavButton, { NavButtonOptions } from '../NavButton/NavButton';
import { Themes } from '../RenderComponent/RenderComponent';
import './NavBar.scss';
const NavBar = ({isVertical, label, theme, setTheme}:{isVertical?: boolean, label?: string, theme: Themes, setTheme:any}) => {
    const navButtons: NavButtonOptions[] = [
        {icon: 'Skull', label: 'Menu Item'},
        {icon: 'Bat', label: 'Menu Item'},
        {icon: 'Pumpkin', label: 'Menu Item'},
    ]
    return (
        <div className={'navBarContainer ' + (isVertical ? 'vertical' : 'horizontal')} >
            <div className='navBarLabel'>{label}</div>
            {navButtons.map(y=>{
                return <NavButton options={y}/>
            })}
        </div>
    )
}
export default NavBar;
